import React, { Component } from 'react';
import About from './about';
import HomePage from './homepage';
import Contact from './contact';
import {Link} from 'react-scroll';

class Nav extends Component {
  render(){
   return (
      <div style={{backgroundColor:'red',position:'fixed',zIndex:2,color:'white',top:10}}>
      
       <Link
          style={{left:500}}
          activeClass="active"
          to="homepage"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      >Homepage</Link>
       <Link
          style={{left:800}}
          activeClass="active"
          to="about"
          spy={true}
          smooth={true}
          offset={0}
          duration={500}
      >About</Link>
      <Link
          className='navbar'
          activeClass="active"
          to="skills"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      >Skills</Link>
      <Link
          className='navbar'
          activeClass="active"
          to="resume"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      >Resume</Link>
      <Link
          className='navbar'
          activeClass="active"
          to="portfolio"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      >Portfolio</Link>
       <Link
          className='navbar'
          activeClass="active"
          to="contact"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      >Contact</Link>
     
      
  </div>
    );
  }
}

export default Nav;
